(ns nossal.styles.main
  (:require [garden.def :refer [defstylesheet defstyles]]
            [garden.units :as gu :refer [px em percent]]
            [garden.color :as color :refer [rgba]]
            [garden.stylesheet :refer [at-font-face]]))

(def reset
  [])

(defstyles screen
  [:body
   {:font-family "sans-serif"
    :font-size (px 11)
    :background-color "#70757D"
    :color "#FFF"
    :margin 0
    :padding 0}]

    (at-font-face
     {:font-family "adelle"
      :font-style "normal";
      :font-weight "400"
      :src "url(data:font/opentype;base64,
  )"})

  [:section :header
   {:margin-left (px 20)}]

  [:h1
   {:font-family "adelle"
    :font-size (em 4.5)
    :font-weight "400"
    :margin "auto"
    :text-shadow "1px 1px 2px rgba(0, 0, 0, 0.5)"}]

  [:footer
   {:font-family "PT Sans Narrow, Arial Narrow, sans-serif"
    :text-transform "uppercase"
    :text-align "center"
    :letter-spacing (em 0.03)
    :font-size (px 10)
    :color "#5B6068"
    :background-color (rgba 255 255 255 0.3)
    :line-height (px 20)
    :position "absolute"
    :width (percent 100)
    :bottom (px 0)}
    [:a {:color (rgba 0 0 0 0.3)}]
    [:.heart
     {:color "#CC5353";"#CF0909"
      :font-family "Raleway"
      :font-size (px 11)}]])
